import React from "react";
import { Button } from "antd";
import { Link } from "react-router-dom";
import "./HomePage.css";

export default class HomePage extends React.Component {
  render() {
    return (
      <div>
        <img
          src="https://www.theindiaforum.in/sites/default/files/field/image/2019/10/01/Ramkumar%20Radhakrishnan%2C%20Wikimedia-1569929663.jpeg"
          alt="img"
        />
        <div className="buy-sell">
          <div>
            <Link to="/buy">
              <Button type="primary" className="buy-sell-button">
                <b>Buy</b>
              </Button>
            </Link>
          </div>
          <div>
            <Link to="/sell">
              <Button type="secondary" className="buy-sell-button">
                <b>Sell</b>
              </Button>
            </Link>
          </div>
        </div>
      </div>
    );
  }
}
